import React from "react"
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Dashboard from "./Dashboard/Dashboard";

const PageRoutes = () =>{
    return(
        <Router>
            <Routes>
                <Route path="/dashboard" element={<Dashboard/>} />
            </Routes>
        </Router>
    )
}

export default PageRoutes
